let hasRecords = false;
if (searchResults && searchResults.records && Array.isArray(searchResults.records) && searchResults.records.length > 0) {
  hasRecords = true;
} else if (searchResults && searchResults.id) {
  // Sometimes Airtable returns the record directly
  hasRecords = true;
}

// Get the normalized data from Smart Field Mapper
const normalizedData = $node["Smart Field Mapper"].json;

if (hasRecords) {
  // Duplicate found
  let existingRecord;
  if (searchResults.records && searchResults.records.length > 0) {
    existingRecord = searchResults.records[0];
  } else {
    existingRecord = searchResults;
  }

  console.log('DUPLICATE FOUND:', existingRecord.id || existingRecord.getId || 'unknown-id');

  return {
    duplicate: true,
    duplicateCount: (existingRecord.fields?.duplicate_count || existingRecord.duplicate_count || 0) + 1,
    recordId: existingRecord.id || existingRecord.getId,
    ...normalizedData  // Pass through all data from Smart Field Mapper
  };
} else {
  // No duplicate
  console.log('NO DUPLICATE - Creating new record for:', normalizedData.normalized.email);
  return {
    duplicate: false,
    duplicateCount: 0,
    ...normalizedData  // Pass through all data from Smart Field Mapper
  };
}

// PDL Person API Response Processor v1.0
// Extracts person data and maps to Airtable fields

const pdlResponse = $json;
const smartFieldData = $node['Smart Field Mapper'].json.normalized;

// Initialize processed data with existing Smart Field Mapper data
const processedData = {
  ...smartFieldData,
  // PDL Person API Processing
  pdl_person_processed: new Date().toISOString(),
  pdl_person_cost: 0.03 // $0.03 per call
};

// Process PDL Person Response
if (pdlResponse && pdlResponse.data) {
  const person = pdlResponse.data;

  // Extract person profile data
  if (person.full_name) {
    processedData.pdl_full_name = person.full_name;
  }

  if (person.first_name) {
    processedData.pdl_first_name = person.first_name;
  }

  if (person.last_name) {
    processedData.pdl_last_name = person.last_name;
  }

  // Extract job information
  if (person.job_title) {
    processedData.pdl_job_title = person.job_title;
  }

  if (person.job_title_role) {
    processedData.pdl_job_role = person.job_title_role;
  }

  if (person.job_company_name) {
    processedData.pdl_company_name = person.job_company_name;
  }

  // Extract LinkedIn profile
  if (person.linkedin_url) {
    processedData.pdl_linkedin_url = person.linkedin_url;
  }

  // Extract location data
  if (person.location_name) {
    processedData.pdl_location = person.location_name;
  }

  if (person.location_country) {
    processedData.pdl_country = person.location_country;
  }

  // Extract seniority level
  if (person.job_title_levels && person.job_title_levels.length > 0) {
    processedData.pdl_seniority = person.job_title_levels[0];
  }

  // Determine if person is in sales role
  const salesRoles = ['sales', 'business development', 'account manager', 'revenue', 'growth'];
  const jobTitle = (person.job_title || '').toLowerCase();
  const jobRole = (person.job_title_role || '').toLowerCase();

  processedData.pdl_is_sales_role = salesRoles.some(role => 
    jobTitle.includes(role) || jobRole.includes(role)
  );

  // Extract industry information
  if (person.industry) {
    processedData.pdl_industry = person.industry;
  }

  // Process phone numbers from PDL
  if (person.phone_numbers && person.phone_numbers.length > 0) {
    const primaryPhone = person.phone_numbers[0];
    if (primaryPhone) {
      processedData.pdl_phone = primaryPhone;
    }
  }

  // Extract experience information
  if (person.experience && person.experience.length > 0) {
    const currentJob = person.experience[0]; // Most recent job
    if (currentJob) {
      if (currentJob.company && currentJob.company.name) {
        processedData.pdl_current_company = currentJob.company.name;
      }
      if (currentJob.title) {
        processedData.pdl_current_title = currentJob.title;
      }
    }
  }

  // Calculate person qualification score (0-100)
  let personScore = 0;

  // Has LinkedIn profile (+25 points)
  if (person.linkedin_url) personScore += 25;

  // Has job title (+20 points)
  if (person.job_title) personScore += 20;

  // Is in sales role (+30 points)
  if (processedData.pdl_is_sales_role) personScore += 30;

  // Has company information (+15 points)
  if (person.job_company_name) personScore += 15;

  // Has location data (+10 points)
  if (person.location_country) personScore += 10;

  processedData.pdl_person_score = personScore;

  // Determine qualification status
  processedData.pdl_person_qualified = personScore >= 70;

  // Extract additional contact methods
  if (person.emails && person.emails.length > 0) {
    const workEmail = person.emails.find(email => email.type === 'work');
    if (workEmail) {
      processedData.pdl_work_email = workEmail.address;
    }
  }

  // Success status
  processedData.pdl_person_success = true;
  processedData.pdl_person_error = null;

} else {
  // Handle API error or no data
  processedData.pdl_person_success = false;
  processedData.pdl_person_error = pdlResponse.error || 'No person data found';
  processedData.pdl_person_score = 0;
  processedData.pdl_person_qualified = false;
}

// Return processed data for next node
return { normalized: processedData };

// ICP Response Processor V3.1  OpenAI compatible
// Parses OpenAI chat completion (choices[0].message.content) or legacy Claude format

const aiResp = $json;
const leadData = $node['PDL Person Processor'].json.normalized;

// Base result object
let scoringResult = {
  ...leadData,
  icp_scoring_attempted: true,
  icp_scoring_date: new Date().toISOString(),
  openai_cost: 0.001 // update with real cost model if needed
};

// Helper: try to extract text from various response shapes
const respText =
  aiResp?.choices?.[0]?.message?.content ??
  aiResp?.content?.[0]?.text ??
  null;

if (respText) {
  try {
    const scoreData = JSON.parse(respText.trim());

    scoringResult.icp_score = scoreData.total_score ?? 0;
    scoringResult.company_score = scoreData.company_score ?? 0;
    scoringResult.role_score = scoreData.role_score ?? 0;
    scoringResult.engagement_score = scoreData.engagement_score ?? 0;
    scoringResult.score_reasoning = scoreData.reasoning ?? 'AI scoring';
    scoringResult.scoring_confidence = scoreData.confidence ?? 0.8;
    scoringResult.scoring_method_used = 'openai_chat';
    scoringResult.ai_success = true;

    // Tiering
    if (scoringResult.icp_score >= 90) scoringResult.icp_tier = 'Ultra';
    else if (scoringResult.icp_score >= 75) scoringResult.icp_tier = 'High';
    else if (scoringResult.icp_score >= 70) scoringResult.icp_tier = 'Medium';
    else if (scoringResult.icp_score >= 50) scoringResult.icp_tier = 'Low';
    else scoringResult.icp_tier = 'Archive';
  } catch (err) {
    console.log('AI response JSON parse failed', err.message);
    scoringResult.ai_success = false;
    scoringResult.ai_error = err.message;
    scoringResult = { ...scoringResult, ...calculateDomainFallback(leadData) };
  }
} else {
  // No usable text  fallback
  scoringResult.ai_success = false;
  scoringResult.ai_error = 'Empty or unrecognised response';
  scoringResult = { ...scoringResult, ...calculateDomainFallback(leadData) };
}

function calculateDomainFallback(data) {
  let companyScore = 8;
  let roleScore = 0;
  let engagementScore = 0;

  const emailDomain = data.email ? data.email.split('@')[1] : '';
  const domainScores = {
    'salesforce.com': 15, 'hubspot.com': 15, 'microsoft.com': 15,
    'zoom.us': 15, 'slack.com': 15, 'atlassian.com': 15,
    'accenture.com': 5, 'deloitte.com': 5
  };
  companyScore = domainScores[emailDomain] || 8;

  const title = (data.pdl_job_title || data.title || '').toLowerCase();
  if (title.includes('account executive') || title.includes('ae')) {
    roleScore = title.includes('enterprise') ? 25 : 20;
  } else if (title.includes('account director') || title.includes('account manager')) {
    roleScore = 18;
  } else if (title.includes('sales manager') || title.includes('team lead')) {
    roleScore = 10;
  } else if (title.includes('vp') || title.includes('director')) {
    roleScore = 8;
  } else if (title.includes('sdr') || title.includes('bdr')) {
    roleScore = 3;
  }

  if (data.interested_in_coaching === true) engagementScore += 15;
  if (data.source_form?.toLowerCase().includes('webinar')) engagementScore += 8;
  if (data.pdl_linkedin_url) engagementScore += 5;

  const totalScore = Math.min(companyScore + roleScore + engagementScore, 100);
  let tier = 'Archive';
  if (totalScore >= 90) tier = 'Ultra';
  else if (totalScore >= 75) tier = 'High';
  else if (totalScore >= 70) tier = 'Medium';
  else if (totalScore >= 50) tier = 'Low';

  return {
    icp_score: totalScore,
    company_score: companyScore,
    role_score: roleScore,
    engagement_score: engagementScore,
    icp_tier: tier,
    score_reasoning: 'Domain fallback scoring  AI unavailable',
    scoring_confidence: 0.7,
    scoring_method_used: 'domain_fallback'
  };
}

return { normalized: scoringResult };

// Archive Low Scores - Phase 2B
// Processes leads with ICP scores below qualification threshold

const leadData = $json.normalized;

// Log archival reason
console.log(`Archiving lead ${leadData.email} - ICP Score: ${leadData.icp_score}, Tier: ${leadData.icp_tier}`);

// Set archival metadata
const archivedLead = {
  ...leadData,
  archived_date: new Date().toISOString(),
  archived_reason: 'icp_score_below_threshold',
  routing: 'archive',
  processing_status: 'Archived',
  processing_completed: new Date().toISOString()
};

// Return processed data for Airtable storage
return { normalized: archivedLead };

